const user=(props)=>{
    return (
        <div>
            <h1>{props.name}</h1>
            <p>Age: {props.age}</p>
            <style jsx>{
                `
             div{
                 border:1px solid #eee;
                 text-align:center;
                 padding:20px;
             }
             p{
                 color:red;
             } `
            }

            </style>
        </div>
    )

}
export default user;
